import React from "react";
import sunny from '../icons/sunny.png'
import '../styles/style.css'

const CurrentWeather = () => {
    
  return (
    <div className="current-weather-wrapper">
      <div>
        <h1 className="current-temperature">25ยบ</h1>
      </div>
      <div className>
        <h2 className="current-location">Leiria</h2>
        <h5 className="current-time">12:15H - Mon, 05 May '21</h5>
      </div>
      <div>
      <img className="current-weather-icon" src={sunny} alt="weather-icon" />
        
      </div>
    </div>
  );
};

export default CurrentWeather;
